description:
18 Year Old Virgin (2009)


Verenigde Staten
Komedie
78 minuten

geregisseerd door Tamara Olson
met Olivia Alaina May, Kim Argetsinger en Cole Carson

Katie is een 18-jarig meisje dat wanhopig probeert om een echte vrouw te worden door haar maagdelijkheid te verliezen. En dat nog het liefst vooraleer ze afgestudeerd is. Dit gaat haar echter moeilijker af dan dat ze had verwacht.


